import Header from './Header'
import Footer from './Footer'

const Layout = props => (
    <div>
        <Header/>
        {props.children}
        <Footer/>
        <style jsx global>{`
            * {
                box-sizing: border-box;
            }
        
            body {
                margin: 0;
            }
        `}</style>
    </div>
)

export default Layout
